import React from 'react';
import {Link} from 'react-scroll';

export default function Scroll(){

    return (
        <div>
            <h1>Featured Projects</h1>
            <Link activeClass="active" to="text" spy={true} smooth={true}>
            <button id = "scroll" >Scroll!</button>
            </Link>
        </div>
    )
}
